import Link from 'next/link';

const NavBars = () => (

    <div className="navigateBar">

    <div>
      <Link href="/Work"><a>WORK</a></Link>
      </div>

       <div>
       <Link href="/About">ABOUT</Link>
       </div>

     <div>
     <Link href="/contact">CONTACT</Link> 
     </div>

     <style jsx>{`
        div{
          text-align:center;
          font-family: 'Courier New', Courier, monospace;
        }
        #navigateBar{
          color: pink;
          
        }
        
      `}</style>


     </div>
);

export default NavBars;
